erceptionString:"Is the subjective judgment that people make about the characteristics and severity of a risk.",risk_perceptionString1:"What perception of risk do you have?",risk_propensityString:"The degree an entity is prepared to take a chance with the risk of a loss.",risk_propensityString1:"How much are you willing to risk?",opennessString:"Indicates how open-minded a person is. Individuals with a high level of openness have a general appreciation for unusual ideas and art. They are usually imaginative, rather than practical.",opennessString1:"How open-minded are you?",scarcityString:"Tendency to assign more value to items and opportunities when their availability is limited, not to waste the opportunity.",scarcityString1:"Are you willing to make the most of the opportunities of this moment?",consistencyString:"Tendency to behave in a way consistent with past decisions and behaviours. Consistency is an adaptive behavior that has been very beneficial. Doing certain things the same way and making decisions according to the same values helps us survive in a complex world.",consistencyString1:"Do you always behave the same way when you read an email?",social_proofString:"Tendency to reference the behaviour of others, by using the majority behaviour to guide their own actions.",social_proofString1:"How much does your actions depend on the behavior of others?",gratitudeString:'Tendency to feel obliged to repay favours from others.“I do something for you, you do something for me." Reciprocity is the impulse we feel to return the favor after we are helped by someone or given value.',gratitudeString1:"Are you grateful to people?",authorityString:"Tendency to obey people in authoritative positions, following from the possibility of punishment for not complying with the authoritative requests.",authorityString1:"How do you obey authority?",jobField:"Job Field  ",employmentType:"Employment Type  ",yearsofEx:"Years of job experience  ",mailboxUsage:"Mailbox usage context  "